import FriendItem from "./FriendItem";

const FriendList = ({
	friends }) => {
	console.log(friends)
	return (
		<ul class="friend-list">
			{friends.map(el => (
				<FriendItem
					key={el.id}
					avatar={el.avatar}
					name={el.name}
					isOnline={el.isOnline}
				/>
			))}
		</ul>

	)

}
export default FriendList
